import {BrowserRouter as Router, Switch, Route} from 'react-router-dom'
import Signup from './Signup'
import Home from './Home'

export default function App() {
  return (
  <Router>
      <Switch>
        {/* <Router path = "/" component = {Home}/> */}
        <Route path = "/signup" component = {Signup} />
      </Switch>
    </Router>
  )
}
